APRIMATIC_TX2M_PREAMBLE_PARTIAL_BITS = 29
APRIMATIC_TX2M_FINAL_PARTIAL_BITS = 8
APRIMATIC_TX2M_BIT_RATE = 600
APRIMATIC_TX2M_PARTIAL_BITS_PER_BIT = 6
APRIMATIC_TX2M_PARTIAL_BITS_FOR_ZERO = '000011'
APRIMATIC_TX2M_PARTIAL_BITS_FOR_ONE = '011111'
APRIMATIC_TX2M_PARTIAL_BIT_RATE = APRIMATIC_TX2M_BIT_RATE * APRIMATIC_TX2M_PARTIAL_BITS_PER_BIT
APRIMATIC_TX2M_MESSAGE_BITS = 80
APRIMATIC_TX2M_MODULATION_FREQUENCY = 433920000

_ONE = '1'
_ZERO = '0'

_MY_DEBUG = False


