def convert_message_to_partial_bit_string(message: str):
    partial_bit_string = ''

    for bit in message:
        if bit == _ZERO:
            partial_bit_string += APRIMATIC_TX2M_PARTIAL_BITS_FOR_ZERO
        elif bit == _ONE:
            partial_bit_string += APRIMATIC_TX2M_PARTIAL_BITS_FOR_ONE

    return partial_bit_string


